import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const Signup = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    AuthID: '',
    AuthKey: '',
    CustRefNum: '',
    txn_Amount: '',
    PaymentDate: new Date().toISOString().slice(0, 19).replace('T', ' '),
    ContactNo: '',
    EmailId: '',
    IntegrationType: 'nonseamless',
    CallbackURL: '',
    adf1: 'NA',
    adf2: 'NA',
    adf3: 'NA',
    MOP: 'NA',
    MOPType: 'NA',
    MOPDetails: 'NA'
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    
    // Save to localStorage (for demo) or send to backend
    localStorage.setItem('merchantData', JSON.stringify(formData));
    alert('Signup successful! Redirecting...');
    navigate('/main');
  };

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial' }}>
      <h2>Merchant Signup</h2>
      <form onSubmit={handleSubmit}>
        <input
          name="AuthID"
          placeholder="AuthID"
          value={formData.AuthID}
          onChange={handleChange}
          required
          style={inputStyle}
        />
        <input
          name="AuthKey"
          placeholder="AuthKey"
          value={formData.AuthKey}
          onChange={handleChange}
          required
          style={inputStyle}
        />
        <input
          name="CustRefNum"
          placeholder="CustRefNum"
          value={formData.CustRefNum}
          onChange={handleChange}
          required
          style={inputStyle}
        />
        <input
          name="txn_Amount"
          placeholder="Default Amount"
          value={formData.txn_Amount}
          onChange={handleChange}
          type="number"
          step="0.01"
          required
          style={inputStyle}
        />
        <input
          name="ContactNo"
          placeholder="ContactNo"
          value={formData.ContactNo}
          onChange={handleChange}
          required
          style={inputStyle}
        />
        <input
          name="EmailId"
          placeholder="EmailId"
          value={formData.EmailId}
          onChange={handleChange}
          required
          style={inputStyle}
        />
        <input
          name="CallbackURL"
          placeholder="CallbackURL"
          value={formData.CallbackURL}
          onChange={handleChange}
          required
          style={inputStyle}
        />
        <button type="submit" style={buttonStyle}>
          Save & Go to Main
        </button>
      </form>
    </div>
  );
};

const inputStyle = { display: 'block', margin: '10px 0', padding: '8px', width: '300px' };
const buttonStyle = { padding: '10px 15px', backgroundColor: '#007BFF', color: 'white', border: 'none', cursor: 'pointer' };

export default Signup;
